class Solution {
    func goodSubsetofBinaryMatrix(_ grid: [[Int]]) -> [Int] {
        let m = grid.count
        let n = grid[0].count
        var result: [Int] = []

        // Check if single row is a good subset
        for i in 0..<m {
            if grid[i].reduce(0, +) <= n / 2 {
                return [i]
            }
        }

        // Check combinations of two rows
        if m > 1 {
            for i in 0..<(m - 1) {
                for j in (i + 1)..<m {
                    let sum = zip(grid[i], grid[j]).map(+)
                    if sum.allSatisfy({ $0 <= 1 }) {
                        return [i, j]
                    }
                }
            }
        }

        // If no good subset found
        return result
    }
}
